import React,{useEffect,useState} from 'react'
import axios from 'axios'

const ApiExterno = () => {
    const [tabela, setTabela]=useState()

    useEffect(()=>{
        axios.get('http://localhost:3004/promotions').then((resp)=>{
            setTabela(resp.data)
        })
    }, [])

    return(
        <div>
            <img src={tabela.imageUrl} alt={tabela.title}/>
            <div>
                <h1>{tabela.title}</h1>
                <span>R$: </span>
            </div>
        </div>
    )
}
export default ApiExterno;
